import React, {Suspense, useEffect} from 'react';
import './usageLog.css';
import '../index.css'

function UsageLog() {

    useEffect(() => { 

    })
  
    return (
    <>
        <div className="usagelog ui outer container p-20">
            <p>
                <b>last push message: </b><span className='push-text'></span>
            </p>
            
            <p>
                <b>API status:</b><span className='api-status'> API Has not been activated yet.</span>
            </p>
            
            <div className='log-wrap'>
                <b>API usage info log:</b><br/><pre className="log-info"></pre>
            </div>
        </div>
    </>
    );
  }

  export {UsageLog}
